  \"2013-03-19T00:33:39.874848\",\n\t\"name\": \"a-guide-to-the-late-quaternary-history-of-northern-and-western-kenai-peninsula-alaska\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Between 27 and 11 kyr ago, during the last
  major (Naptowne) glaciation, the northwestern and western Kenai Peninsula and the
  Cook Inlet trough were covered by ice except for local nunataks and small refugia,
  like the Caribou Hills. Landforms related to four glacial stades are recognized
  and paleogeographic maps document ice limits, drainage systems, glacial-impounded
  lakes, and glaciomarine terraces. Numerous multidisciplinary studies of glacial,
  vegetation, and insect histories document Holocene climatic changes.\",\n\t\"license_title\":
